import { Component } from 'react'

import './profil.css'

class Profil extends Component {
  render() {
    return (
      <div className="profil">
        <p>{this.props.name}</p>
        <p>
          <img src={this.props.photo} alt={`Profil de ${this.props.name}`} />
        </p>
      </div>
    )
  }
}

export default Profil
